  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <h2 {...{
      "id": "1、镜像下载慢，如何提高下载速度？"
    }}>{`1、镜像下载慢，如何提高下载速度？`}</h2>
    <pre><code parentName="pre" {...{}}>{`touch /etc/docker/daemon.json
cat >> /etc/docker/daemon.json <<EOF
{
"insecure-registries": ["0.0.0.0/0"],
"registry-mirrors": ["https://7bezldxe.mirror.aliyuncs.com"]
}
EOF
systemctl daemon-reload && systemctl restart docker
`}</code></pre>
    <pre><code parentName="pre" {...{}}>{`PS:0.0.0.0/0 表示信任所有非https地址的镜像仓库，对于内网测试，这样配置很方便。对于线上生产环境，
为了安全请不要这样配置
`}</code></pre>
    <h2 {...{
      "id": "2、如何配置-docker-后端存储驱动？"
    }}>{`2、如何配置 Docker 后端存储驱动？`}</h2>
    <p>{`以 overlay 为例`}</p>
    <pre><code parentName="pre" {...{}}>{`touch /etc/docker/daemon.json
cat >> /etc/docker/daemon.json <<EOF
{
"storage-driver": "overlay"
}
EOF
systemctl daemon-reload && systemctl restart docker
`}</code></pre>
    <h2 {...{
      "id": "3、docker-info-出现-warning"
    }}>{`3、docker info 出现 WARNING`}</h2>
    <pre><code parentName="pre" {...{}}>{`WARNING: No swap limit support
WARNING: No kernel memory limit support
WARNING: No oom kill disable support
`}</code></pre>
    <p>{`编辑`}<inlineCode parentName="p">{`/etc/default/grub`}</inlineCode>{` 文件，并设置:
`}<inlineCode parentName="p">{`GRUB_CMDLINE_LINUX="cgroup_enable=memory swapaccount=1"`}</inlineCode></p>
    <p>{`接着`}</p>
    <p>{`SUSE`}</p>
    <pre><code parentName="pre" {...{}}>{`grub2-mkconfig -o /boot/grub2/grub.cfg
`}</code></pre>
    <p>{`Cetos`}</p>
    <pre><code parentName="pre" {...{}}>{`Update grub
`}</code></pre>
    <p>{`Ubuntu`}</p>
    <pre><code parentName="pre" {...{}}>{`update-grub
`}</code></pre>
    <h2 {...{
      "id": "4、我怎么通过-rancher-让-docker-里的程序代理上网呢？"
    }}>{`4、我怎么通过 rancher 让 docker 里的程序代理上网呢？`}</h2>
    <p>{`启动容器的时候添加：`}</p>
    <pre><code parentName="pre" {...{}}>{`-e http_proxy=  -e https_proxy=
`}</code></pre>
    <p><img parentName="p" {...{
        "src": "/img/rancher1/faqs/proxy.png",
        "alt": "proxy"
      }}></img></p>
    <h2 {...{
      "id": "5、docker-error-unable-to-remove-filesystem"
    }}>{`5、Docker Error: Unable to remove filesystem`}</h2>
    <p>{`Some container-based utilities, such as Google cAdvisor, mount Docker system directories, such as /var/lib/docker/, into a container. For instance, the documentation for cadvisor instructs you to run the cadvisor container as follows:`}</p>
    <pre><code parentName="pre" {...{}}>{`$ sudo docker run \\
  --volume=/:/rootfs:ro \\
  --volume=/var/run:/var/run:rw \\
  --volume=/sys:/sys:ro \\
  --volume=/var/lib/docker/:/var/lib/docker:ro \\
  --publish=8080:8080 \\
  --detach=true \\
  --name=cadvisor \\
  google/cadvisor:latest
`}</code></pre>
    <p>{`When you bind-mount `}<inlineCode parentName="p">{`/var/lib/docker/`}</inlineCode>{`, this effectively mounts all resources of all other running containers as filesystems within the container which mounts `}<inlineCode parentName="p">{`/var/lib/docker/`}</inlineCode>{`. When you attempt to remove any of these containers, the removal attempt may fail with an error like the following:`}</p>
    <pre><code parentName="pre" {...{}}>{`Error: Unable to remove filesystem for
74bef250361c7817bee19349c93139621b272bc8f654ae112dd4eb9652af9515:
remove /var/lib/docker/containers/74bef250361c7817bee19349c93139621b272bc8f654ae112dd4eb9652af9515/shm:
Device or resource busy
`}</code></pre>
    <p>{`The problem occurs if the container which bind-mounts `}<inlineCode parentName="p">{`/var/lib/docker/`}</inlineCode>{` uses `}<inlineCode parentName="p">{`statfs`}</inlineCode>{`or `}<inlineCode parentName="p">{`fstatfs`}</inlineCode>{` on filesystem handles within `}<inlineCode parentName="p">{`/var/lib/docker/`}</inlineCode>{` and does not close them.`}</p>
    <p>{`Typically, we would advise against bind-mounting `}<inlineCode parentName="p">{`/var/lib/docker`}</inlineCode>{` in this way. However, cAdvisor requires this bind-mount for core functionality.`}</p>
    <p>{`If you are unsure which process is causing the path mentioned in the error to be busy and preventing it from being removed, you can use the lsof command to find its process. For instance, for the error above:`}</p>
    <pre><code parentName="pre" {...{}}>{`sudo lsof /var/lib/docker/containers/74bef250361c7817bee19349c93139621b272bc8f65
`}</code></pre>
    </MDXLayout>;
}

